(text, 'maxSize').min(0).step(0.25); // Mix and match</pre>\n\n  <p>You can also choose to select from a dropdown of values for both numbers\n    and strings.</p>\n\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">\n// Choose from accepted values\ngui.add(text, 'message', [ 'pizza', 'chrome', 'hooray' ] );\n\n// Choose from named values\ngui.add(text, 'speed', { Stopped: 0, Slow: 0.1, Fast: 5 } );</pre>\n\n</article>\n\n<article>\n  <h1>3. Folders</h1>\n\n  <p>You can nest as many GUI's as you please. Nested GUI's act as collapsible folders.</p>\n\n  <pre class=\"prettyprint  rag-top rag-bottom lang-js\">var gui = new dat.GUI();\n\nvar f1 = gui.addFolder('Flow Field');\nf1.add(text, 'speed');\nf1.add(text, 'noiseStrength');\n\nvar f2 = gui.addFolder('Letters');\nf2.add(text, 'growthSpeed');\nf2.add(text, 'maxSize');\nf2.add(text, 'message');\n\nf2.open();</pre>\n\n</article>\n\n\n<article>\n  <h1>4. Color Controllers</h1>\n\n  <p><code>dat.GUI</code> has a color selector and understands many\n    different representations of color. The following creates color\n    controllers for color variables of different formats.</p>\n\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">var FizzyText = function() {\n\n  this.color1 = \"#ffae23\"; // CSS string\n  this.color2 = [ 0, 128, 255 ]; // RGB array\n  this.color3 = [ 0, 128, 255, 0.3 ]; // RGB with alpha\n  this.color4 = { h: 350, s: 0.9, v: 0.3 }; // Hue, saturation, value\n\n  // Define render logic ...\n\n};\n\nwindow.onload = function() {\n\n  var text = new FizzyText();\n  var gui = new dat.GUI();\n\n  gui.addColor(text, 'color0');\n  gui.addColor(text, 'color1');\n  gui.addColor(text, 'color2');\n  gui.addColor(text, 'color3');\n\n};</pre>\n\n  <p><code>dat.GUI</code> will modify colors in the format defined by their\n    initial value. </p>\n\n</article>\n\n<article>\n  <h1>5. Saving Values</h1>\n\n  <p>Add a save menu to the GUI interface by calling <code>gui.remember</code>\n    on all the objects you've added to the GUI.</p>\n\n  <pre class=\"prettyprint rag-bottom lang-js\">var fizzyText = new FizzyText();\nvar gui = new dat.GUI();\n\ngui.remember(fizzyText);\n\n// Add controllers ...</pre>\n\n  <p>Click the <span id=\"save-icon\"> </span> icon to change your save settings. You can either save your\n    GUI's values to <code>localStorage</code>, or by copying and pasting a JSON\n    object into your source code as follows:</p>\n\n  <pre class=\"prettyprint rag-bottom lang-js\">var fizzyText = new FizzyText();\nvar gui = new dat.GUI({ load: JSON });\n\ngui.remember(fizzyText);\n\n// Add controllers ...</pre>\n\n</article>\n\n<article>\n  <h1>6. Presets</h1>\n\n  <p>The save menu also allows you to save all of your settings as presets.\n    Click <strong>Save</strong> to modify the current preset, or <strong>New</strong> to create a new\n    preset from existing settings. Clicking <strong>Revert</strong> will clear all unsaved changes to the current preset.</p>\n\n  <p>Switch between presets using the dropdown in the save menu. You can specify\n    the default preset as follows:</p>\n\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">var gui = new dat.GUI({\n  load: JSON,\n  preset: 'Flow'\n});</pre>\n\n  <p class=\"caution\">A word of caution about <code>localStorage</code>:</p><p>Paste the JSON save object into your source frequently. Using <code>localStorage</code> to save presets can make you faster, but its easy to lose your settings by clearing browsing data, changing browsers, or even by changing the URL of the page you're working on.</p>\n\n  <\!-- <p>These functions can also be triggered programmatically.</p> --\>\n\n  <\!-- <pre>\n        gui.save(); // Modify current settings\n        gui.saveAs('New Preset Name'); // New preset\n      </pre> --\>\n\n</article>\n\n<article>\n  <h1>7. Events</h1>\n\n  <p>You can listen for events on individual controllers using an event listener\n    syntax.</p>\n\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">var controller = gui.add(fizzyText, 'maxSize', 0, 10);\n\ncontroller.onChange(function(value) {\n  // Fires on every change, drag, keypress, etc.\n});\n\ncontroller.onFinishChange(function(value) {\n  // Fires when a controller loses focus.\n  alert(\"The new value is \" + value);\n});</pre>\n</p>\n</article>\n\n<article>\n  <h1>8. Custom Placement</h1>\n\n  <p>By default, dat.GUI panels are created with fixed position, and are\n    automatically appended to a DOM Element of dat.GUI's creation.</p>\n\n  <p>You can change this behavior by setting the <code>autoPlace</code>\n    parameter to <code>false</code>.\n\n    <pre class=\"prettyprint rag-bottom lang-js\">var gui = new dat.GUI({ autoPlace: false });\n\nvar customContainer = document.getElementById('my-gui-container');\ncustomContainer.appendChild(gui.domElement);</pre>\n\n\n</article>\n\n<article>\n  <h1>9. Updating the Display Automatically</h1>\n\n  <p>If you'd like controllers to react to changes made outside of the GUI, use\n    the <code>listen</code> method.\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">var fizzyText = new FizzyText();\nvar gui = new dat.GUI();\n\ngui.add(fizzyText, 'noiseStrength', 0, 100).listen();\n\nvar update = function() {\n  requestAnimationFrame(update);\n  fizzyText.noiseStrength = Math.random();\n};\n\nupdate();</pre>\n  <p>Calling <code>listen</code> on a controller adds it to an internal interval\n    of dat.GUI's creation. This interval checks for changes to a property's\n    value every frame, so if reading that property is expensive, this can be\n    very slow.</p>\n</article>\n\n<article>\n  <h1>10. Updating the Display Manually</h1>\n\n  <p>If you'd like to update controllers in a loop of your own definition, use\n    the <code>updateDisplay</code> method.</p>\n  <pre class=\"prettyprint rag-top rag-bottom lang-js\">var fizzyText = new FizzyText();\nvar gui = new dat.GUI();\n\ngui.add(fizzyText, 'noiseStrength', 0, 100);\n\nvar update = function() {\n\n  requestAnimationFrame(update);\n  fizzyText.noiseStrength = Math.cos(Date.getTime());\n\n  // Iterate over all controllers\n  for (var i in gui.__controllers) {\n    gui.__controllers[i].updateDisplay();\n  }\n\n};\n\nupdate();</pre>\n\n</article>\n</body>\n</html>"});
define("text!dat/slides/style.css",[],function(){return".dat-slides-container {\n  overflow: hidden; }\n  .dat-slides-container.auto-ui {\n    padding-top: 42px; }\n  .dat-slides-container ul.slides {\n    /* transitions */\n    -webkit-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n    -moz-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n    -ms-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n    -o-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n    transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n    height: 100%;\n    padding: 0 !important;\n    margin: 0;\n    position: relative; }\n    .dat-slides-container ul.slides > li {\n      display: inline-block;\n      position: relative;\n      padding: 0;\n      vertical-align: top; }\n    .dat-slides-container ul.slides.resize {\n      -webkit-transition: all 0ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n      -moz-transition: all 0ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n      -ms-transition: all 0ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n      -o-transition: all 0ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n      transition: all 0ms cubic-bezier(0.785, 0.135, 0.15, 0.86); }\n  .dat-slides-container .navigation-container {\n    font-family: 'Terminal Dosis', sans-serif;\n    position: fixed;\n    top: 0;\n    right: 0;\n    left: 0;\n    background: #000; }\n    .dat-slides-container .navigation-container ul.navigation {\n      height: 42px;\n      line-height: 42px;\n      width: 100%;\n      margin: 0 auto;\n      padding: 0;\n      position: relative; }\n      .dat-slides-container .navigation-container ul.navigation > li:first-child {\n        border: 0;\n        margin-left: 0;\n        padding-left: 0; }\n      .dat-slides-container .navigation-container ul.navigation li {\n        list-style: none;\n        float: left;\n        color: #fff;\n        border-left: 1px solid #303030;\n        border-right: 1px solid #303030;\n        font-size: 12px;\n        font-weight: 700;\n        background: #000; }\n        .dat-slides-container .navigation-container ul.navigation li:not(:first-child) {\n          padding: 0 18px; }\n        .dat-slides-container .navigation-container ul.navigation li.last {\n          float: right;\n          border-right: 0; }\n        .dat-slides-container .navigation-container ul.navigation li a + a {\n          display: inline-block;\n          padding-left: 10px;\n          margin-left: 10px; }\n        .dat-slides-container .navigation-container ul.navigation li a#back {\n          display: block;\n          padding: 0 20px; }\n        .dat-slides-container .navigation-container ul.navigation li a:link, .dat-slides-container .navigation-container ul.navigation li a:visited {\n          color: #777777;\n          text-decoration: none;\n          text-transform: uppercase;\n          letter-spacing: 2px; }\n        .dat-slides-container .navigation-container ul.navigation li a:hover, .dat-slides-container .navigation-container ul.navigation li a:active {\n          color: #fff; }\n        .dat-slides-container .navigation-container ul.navigation li.next:hover, .dat-slides-container .navigation-container ul.navigation li.prev:hover, .dat-slides-container .navigation-container ul.navigation li.next:hover *, .dat-slides-container .navigation-container ul.navigation li.prev:hover * {\n          color: #fff !important; }\n        .dat-slides-container .navigation-container ul.navigation li.next *, .dat-slides-container .navigation-container ul.navigation li.prev * {\n          font-size: 125%;\n          color: #777777; }\n        .dat-slides-container .navigation-container ul.navigation li.next, .dat-slides-container .navigation-container ul.navigation li.prev {\n          cursor: pointer; }\n        .dat-slides-container .navigation-container ul.navigation li span {\n          font-weight: 700;\n          color: #777777;\n          letter-spacing: 1px; }\n        .dat-slides-container .navigation-container ul.navigation li#dat-slides-desc {\n          min-width: 50px;\n          color: #777777;\n          border: 0;\n          text-align: center;\n          overflow: visible; }\n          .dat-slides-container .navigation-container ul.navigation li#dat-slides-desc span {\n            color: #fff;\n            font-weight: 700;\n            letter-spacing: 3px;\n            position: relative;\n            display: inline-block; }\n\n#dat-slides-toc {\n  -webkit-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n  -moz-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n  -ms-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n  -o-transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n  transition: all 350ms cubic-bezier(0.785, 0.135, 0.15, 0.86);\n  background: #000;\n  position: fixed;\n  top: 42px;\n  left: 174px;\n  border: 0;\n  overflow: hidden; }\n  #dat-slides-toc span {\n    position: absolute;\n    display: block; }\n  #dat-slides-toc ul {\n    margin: 0;\n    padding: 0; }\n  #dat-slides-toc li {\n    border-top: 1px solid #303030;\n    border-left: 0;\n    border-right: 0;\n    border-bottom: 0;\n    padding: 0;\n    text-align: left;\n    display: block;\n    margin: 0;\n    width: 100%;\n    clear: both; }\n    #dat-slides-toc li a {\n      display: block;\n      padding: 0 18px; }\n"});
define("text!dat/gui/saveDialogue.html",[],function(){return'<div id="dg-save" class="dg dialogue">\n\n  Here\'s the new load parameter for your <code>GUI</code>\'s constructor:\n\n  <textarea id="dg-new-constructor"></textarea>\n\n  <div id="dg-save-locally">\n\n    <input id="dg-local-storage" type="checkbox"/> Automatically save\n    values to <code>localStorage</code> on exit.\n\n    <div id="dg-local-explain">The values saved to <code>localStorage</code> will\n      override those passed to <code>dat.GUI</code>\'s constructor. This makes it\n      easier to work incrementally, but <code>localStorage</code> is fragile,\n      and your friends may not see the same values you do.\n      \n    </div>\n    \n  </div>\n\n</div>'});
